const { item } = props;

const type = item.action_type;

let link = "";

const arr = item.action_title.split(/\s+/);

const [action_type, amount, symbol, on, dexName1, dexName2] = arr;

const isBridge = arr[0].toLowerCase() === "bridge";

const isSwap = arr[0].toLowerCase() === "swap";

const isBorrow = arr[0].toLowerCase() === "borrow";
const isRepay = arr[0].toLowerCase() === "repay";
const isSupply = arr[0].toLowerCase() === "supply";

if (isBridge) {
  link = "/guessme.near/widget/ZKEVMSwap.zkevm-bridge";
}
if (isSwap) {
  link = "/guessme.near/widget/ZKEVMSwap.zkevm-swap";
}

if (isSupply) {
  link = "/guessme.near/widget/ZKEVM.AAVE";
}

if (isBorrow || isRepay) {
  link = "/guessme.near/widget/ZKEVM.AAVE?tab=borrow";
}

const onSaveParams = () => {
  if (isBridge) {
    const [action_type, symbol, from, chain] = arr;

    Storage.set("zk-evm-bridge-params", {
      symbol,
      chain,
    });
  }

  if (isSwap) {
    const [action_type, amount, symbol, on, dexName1, dexName2] = arr;

    const token = SwapTokens.find((item) => item.symbol === symbol);
    console.log("token: ", token);

    Storage.set("zk-evm-swap-params", {
      amount,
      symbol,
      dexName: dexName1 + (dexName2 ? " " + dexName2 : ""),
      assetId: token.address,
    });
  }
};

return (
  <Wrapper>
    <div className="trend-card-out" onClick={() => onSaveParams()}>
      <a className="trend-card" href={link}>
        <div className="trend-card-text">
          {type}

          {type === "Swap" && (
            <span className="trend-card-text-number">{item.action_amount}</span>
          )}

          {item.action_title
            .split(" ")
            .slice(type === "Swap" ? 2 : 1)
            .join(" ")}
        </div>

        <div className="trend-card-dapp-name">
          {" "}
          {iconMap[item.template]} {item.template}
        </div>
      </a>
    </div>

    <div className="trend-card-execute-date">
      <div>Total Execution</div>

      <div>{item.count_number}</div>
    </div>
  </Wrapper>
);
